import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

const Header = () => {
    var styles = {
        navbarbrand: {
            fontweight: "bold"
        },
        span: {
            margin: "auto"
        },
        navlink:{
            fontweight: "bold"
        }
    }
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <strong style={styles.navbarbrand} className="navbar-brand">Navigation Bar</strong>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarText" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarText">
                <ul className="navbar-nav mr-auto">
                    <li className="nav-item active">
                        <Link  to="/" className="nav-link">Home</Link>
                    </li>
                </ul>

                <span style={styles.span} className="navbar-text">
                    Welcome!! 
                </span>

                <div class="dropdown">
                    <button class="btn btn-outline-success dropdown-toggle" type="button" id="dropdownMenuButton1" data-bs-toggle="dropdown" aria-expanded="false">
                        Dropdown Menu
                    </button>
                    <ul class="dropdown-menu" aria-labelledby="dropdownMenuButton1">
                        <Link to="/login" class="dropdown-item" className="nav-link">Customer Login</Link>
                        <Link to="/register" class="dropdown-item" className="nav-link">Customer Register</Link>
                        <Link to="/brokerlogin" class="dropdown-item" className="nav-link">Broker Login</Link>
                    </ul>
                </div>

            </div>
        </nav>
    )
}

export default Header;
